import Sobre from "./Sobre";

function Content({page}) {
    if ({page} == "Sobre") {
        return (
            <div className="row m-3">
                <Sobre />
            </div>
        );
    } else {
            <div className="row m-3">
                {page}
            </div>        
    }
};

export default Content;
